// Logo SVG as a string (the green flower logo)
const logoSVG = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="1978" height="1988" viewBox="0 0 1978 1988">
            <image xlink:href="data:image/png;base64," x="0" y="0" width="1978" height="1988"/>
          </svg>`;

     // DOM elements
     const uploadBtn = document.getElementById('upload-btn');
const uploadInput = document.getElementById('upload-input');
const originalCanvas = document.getElementById('original-canvas');
const logoCanvas = document.getElementById('logo-canvas');
const downloadBtn = document.getElementById('download-btn');

// Set high resolution canvases
originalCanvas.width = 1000;
originalCanvas.height = 1000;
originalCanvas.style.width = "500px";
originalCanvas.style.height = "500px";

logoCanvas.width = 1000;
logoCanvas.height = 1000;
logoCanvas.style.width = "500px";
logoCanvas.style.height = "500px";

// Original context
const originalCtx = originalCanvas.getContext('2d');
originalCtx.fillStyle = '#f5f5f5';
originalCtx.fillRect(0, 0, originalCanvas.width, originalCanvas.height);
originalCtx.font = '55px Arial'; // Larger font for high DPI
originalCtx.fillStyle = '#666';
originalCtx.textAlign = 'center';
originalCtx.fillText('No image uploaded yet', originalCanvas.width / 2, originalCanvas.height / 2);

// Logo context
const logoCtx = logoCanvas.getContext('2d');
logoCtx.fillStyle = '#f5f5f5';
logoCtx.fillRect(0, 0, logoCanvas.width, logoCanvas.height);
logoCtx.font = '55px Arial'; // Larger font for high DPI
logoCtx.fillStyle = '#666';
logoCtx.textAlign = 'center';
logoCtx.fillText('Upload an image to see preview', logoCanvas.width / 2, logoCanvas.height / 2);

// Event listeners
uploadBtn.addEventListener('click', () => {
    uploadInput.click();
});

uploadInput.addEventListener('change', handleImageUpload);

downloadBtn.addEventListener('click', () => {
    // Create temporary higher resolution canvas for download
    const tempCanvas = document.createElement('canvas');
    const tempCtx = tempCanvas.getContext('2d');
    
    // Set to even higher resolution for download
    tempCanvas.width = logoCanvas.width * 2;
    tempCanvas.height = logoCanvas.height * 2;
    
    // Scale and draw with high quality
    tempCtx.imageSmoothingQuality = 'high';
    tempCtx.drawImage(
        logoCanvas, 
        0, 0, 
        tempCanvas.width, tempCanvas.height
    );
    
    // Create download link with maximum quality
    const link = document.createElement('a');
    link.download = 'professional-profile-logo.png';
    link.href = tempCanvas.toDataURL('image/png', 1.0); // 1.0 = maximum quality
    link.click();
});

// Draw the logo onto the canvas
function drawLogoOnCanvas() {
    return new Promise((resolve) => {
        const img = new Image();

        // Create a Blob from the SVG string
        const blob = new Blob([logoSVG], { type: 'image/svg+xml' });
        const url = URL.createObjectURL(blob);

        img.onload = () => {
            logoCtx.clearRect(0, 0, logoCanvas.width, logoCanvas.height);
            logoCtx.imageSmoothingQuality = 'high';
            logoCtx.drawImage(img, 0, 0, logoCanvas.width, logoCanvas.height);
            URL.revokeObjectURL(url);
            resolve();
        };

        img.src = url;
    });
}

// Function to handle image upload
function handleImageUpload(e) {
    const file = e.target.files[0];
    if (!file) return;

    const reader = new FileReader();
    reader.onload = async (event) => {
        const img = new Image();
        img.onload = async () => {
            // Set high quality scaling
            originalCtx.imageSmoothingQuality = 'high';
            logoCtx.imageSmoothingQuality = 'high';
            
            // Draw original image
            originalCtx.clearRect(0, 0, originalCanvas.width, originalCanvas.height);
            const scale = Math.min(
                originalCanvas.width / img.width,
                originalCanvas.height / img.height
            );
            const width = img.width * scale;
            const height = img.height * scale;
            const x = (originalCanvas.width - width) / 2;
            const y = (originalCanvas.height - height) / 2;
            originalCtx.drawImage(img, x, y, width, height);

            // Draw logo first
            await drawLogoOnCanvas();

            // Calculate circle position and size
            const canvasRatio = logoCanvas.width / 500;
            const centerX = 250 * canvasRatio;
            const centerY = 250 * canvasRatio;
            const circleRadius = 180 * canvasRatio;

            // Create circular clipping path
            logoCtx.save();
            logoCtx.beginPath();
            logoCtx.arc(centerX, centerY, circleRadius, 0, Math.PI * 2);
            logoCtx.clip();

            // Calculate dimensions to fit image in circle with high quality
            const circleScale = Math.min(
                (circleRadius * 2) / img.width,
                (circleRadius * 2) / img.height
            ) * 1.05; // Slightly larger to ensure full coverage

            const circleWidth = img.width * circleScale;
            const circleHeight = img.height * circleScale;
            const circleX = centerX - circleWidth / 2;
            const circleY = centerY - circleHeight / 2;

            // Draw profile picture inside the circle with high quality
            logoCtx.drawImage(
                img, 
                circleX, 
                circleY, 
                circleWidth, 
                circleHeight
            );
            logoCtx.restore();

            // Show download button
            downloadBtn.classList.remove('hidden');
        };
        img.src = event.target.result;
    };
    reader.readAsDataURL(file);
}
